import logo from './logo.svg';
import './App.css';
import DateTimePicker from 'react-datetime-picker'
import { useState } from 'react';

function App() {
  const [value, onChange] = useState(new Date());

  return (
    <div className="App">
      <DateTimePicker onChange={onChange} yearPlaceholder={"1999"} monthPlaceholder={"04"} dayPlaceholder={"21"} hourPlaceholder={"00"} minutePlaceholder={"00"} secondPlaceholder={"00"}/>
    </div>
  );
}

export default App;
